import React from 'react';

// import icons
import { faLongArrowAltLeft } from "@fortawesome/free-svg-icons";
import { faInstagram } from "@fortawesome/free-brands-svg-icons";
import { faTwitter } from "@fortawesome/free-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
function NavBar({setId}){
    function terugHandler(){
        setId([5]);
    }
    return(
        <div className="NavBar">
            <button className='fa' onClick={terugHandler}> Terug</button>
            <FontAwesomeIcon className="icon" icon={faLongArrowAltLeft} />
        </div> 
    );
}

export default NavBar
